// --- TYPES ---
type Player = {
  id: string;
  name: string;
  surname: string;
  phone: string;
  role: string;
  year: string;
};

type AttendanceStatus = 'present' | 'absent' | 'justified';
type Attendance = Record<string, AttendanceStatus>; // PlayerID -> Status
type Attendances = Record<string, Attendance>; // Date -> Attendance

type MatchStat = {
  goals: number;
  yellowCards: number;
  redCards: number;
  minutesPlayed: number;
};
type MatchStats = Record<string, Record<string, MatchStat>>; // MatchID -> PlayerID -> Stats
type Convocations = Record<string, string[]>; // MatchID -> PlayerIDs

type Tab = 'Partite' | 'Risultati' | 'Classifica' | 'Calendario' | 'Giocatori' | 'Allenamenti' | 'Convocazioni' | 'Statistiche' | 'Assistente AI';

type ChatMessage = {
  sender: 'user' | 'ai';
  text: string;
  groundingChunks?: any[];
};

type CalendarEntry = {
    data: string;
    ora: string;
    casa: string;
    trasferta: string;
    via: string;
    localita: string;
}

